const VictoriaEPage = () => {
  return (
    <div>
      <h1 className="titulo">Exposición genial, máxima nota.</h1>
      <h2 className="titulo">Has conseguido la varita del trabajo en equipo</h2>
      </div>

  );
};


export default VictoriaEPage;
